import React from 'react';

class ServiceList extends React.Component {
  constructor(props) {
    super(props);
    this.toService = this.toService.bind(this);
    this.genreLabel = this.genreLabel.bind(this);
  }

  genreLabel(g) {
    return "?";
  }

  toService(m) {
    var g = "?";
      for (var i = 0; i < this.props.genres.length; i++) {
        if (this.props.genres[i].value == m.genre) {
          g = this.props.genres[i].label;
          break;
        }
      }
	  return (<tbody key={m.guid}><tr><td>{m.title}</td><td>{g}</td></tr></tbody>)
  }

  toService2(s) {
  	  return (<tbody key={s.id}><tr><td>{s.name}</td><td>{s.url}</td></tr></tbody>)
    }

  render() {
    return (
      <table>
        <tbody>
          <tr>
            <th>Name</th>
            <th>URL</th>
          </tr>
        </tbody>
        {this.props.movies.map(this.toService)}
        {this.props.services.map(this.toService2)}
      </table>
    )
  }
}

export default ServiceList;
